import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Landing from './components/landing';


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Landing />} /> 
        <Route path="/login" element={<AuthPage />} />
        <Route path="/signup" element={<AuthPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
